import React from 'react';
import { BrowserRouter } from 'react-router-dom';

import Navbar from './Navbar';
import Footer from './Footer';
import Routes from './Routes';

const App = () => {
  return (
    <BrowserRouter>
      <Navbar />
      <Routes />
      <Footer />
    </BrowserRouter>
  );
};

export default App;
